DROP TABLE IF EXISTS `playerbot_names`;
CREATE TABLE `playerbot_names` (
  `name` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `gender` tinyint unsigned NOT NULL,
  `race` smallint unsigned NOT NULL,
  `class` smallint unsigned NOT NULL,
  `purpose` int unsigned NOT NULL,
  `priority` bit(1) NOT NULL,
  `in_use` bit(1) NOT NULL,
  UNIQUE KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='PlayerbotAI AutoBot names';

